def predict(triples: list[Triple]) -> str:
    sentence = ""
    airport = None
    for triple in triples:
        if triple.predicate == "cityServed":
            if airport is None:
                airport = triple.subject
            sentence += f"{triple.subject} serves {triple.object}. "
        elif triple.predicate == "country":
            sentence += f"{triple.subject} is in {triple.object}. "
        elif triple.predicate == "capital":
            sentence += f"The capital of {triple.subject} is {triple.object}. "
        elif triple.predicate == "elevationAboveTheSeaLevel":
            sentence += f"{triple.subject} is at an elevation of {triple.object} meters. "
        elif triple.predicate == "location":
            sentence += f"{triple.subject} is located in {triple.object}. "
        else:
            if airport is None:
                airport = triple.subject
            if triple.predicate == "isPartOf":
                sentence += f"{triple.subject}, which is part of {triple.object}, "
            elif triple.predicate == "leaderParty":
                sentence += f"{triple.subject}, led by {triple.object}, "
            else:
                sentence += f"{triple.subject} {triple.predicate} {triple.object}. "
                if len(triples) > 1 and triple != triples[-1]:
                    sentence += ", "

    return sentence

